const interpolate = function (text, data) {
  if (!text) {
    return &apos;no input was provided&apos;;    
  } else {
    let template = text;

    template = template.replace(/\{\{([^}]+)\}\}/g, (match) =&gt; {

      match = match.slice(2, -2); // removes curly braces, either sides
      if (!data[match]) {
        return &apos;{{&apos; + match + &apos;}}&apos;;
      }
      return data[match];
    });
    return template;
  }
};

